import styles from "./Cards.module.css"
import Card from "../Card/Card"

const Cards =({pokemones}) =>{
    console.log("beto");
    console.log(pokemones[0]);
    return(
        
        <div className={styles.card}>
            <Card/>
            {pokemones.map((pokemon) => (
                <div key={pokemon.id}>{pokemon.id}</div>
               
            ))}
            <div>este es un div</div>
              {pokemones.map(({ id, name }) => (
                <Card
                    id={id}
                    name={name}
                />
            ))

         //* ers un conponent, no fucion , como esta en {Return}
         }  
        <div className={styles.card}>Card 1</div>
        <div className={styles.card}>Card 2</div>
        <div className={styles.card}>Card 3</div>
        
    
                
        
        </div>
    )
}

export default Cards;
